import React, { Component } from 'react'
import './work.css'
import Header from '../components/header'

class Work extends Component {
    render() {
        return (
            <div>
                <Header></Header>
                <div className='body'>
                    <p>WORK</p>
                </div>
            </div>
        )
    }
}
export default Work;
